import { Card } from 'react-bootstrap';
import './plugin.css';



export default function PriceList(){
    return (
        <div className="price-list">
            <input placeholder="Search" />
            <div className="d-flex justify-content-between">
                <p>USD</p>
                <p>USD</p>
                <p>USD</p>
                
            </div>
        </div>
    );
}
